<script>
var anime = require('../../plugins/anime.min.js');

export default {
  name: 'koala',
  props: ['idsuffix'],
  data () {
    return {
        koalaTargs : {
            koala: '#koala'+this.idsuffix,
            koalaID: 'koala'+this.idsuffix,
            leftArm:'#leftArm'+this.idsuffix,
            leftArmID:'leftArm'+this.idsuffix,
            rightArm:'#rightArm'+this.idsuffix,
            rightArmID:'rightArm'+this.idsuffix
        },
        koala_animation : null
    }
  },
  mounted(){
      
         this.koala_animation = anime.timeline({
            autoplay: false
        }); 
        this.koala_animation.add({
            targets: this.koalaTargs.koala,
            rotate: ['90deg','90deg'],
            opacity: 1,
            duration: 2000
        }).add({
            targets: this.koalaTargs.koala,
            translateX: '30%',
            rotate: '90deg',
            offset: '-=1500',
            duration: 4000,
            elasticity: 0
        }).add({
            targets: this.koalaTargs.leftArm,
            rotate: [
                {
                    value: '70',
                    duration: 750
                },
                {
                    value: '90',
                    duration: 1000
                },
                {
                    value: '70',
                    duration: 1000
                },
                {
                    value: '90',
                    duration: 1000
                },
                {
                    value: '70',
                    duration: 750
                }
                
            ],
            elasticity: 3000,
            easing: 'linear',
            offset: '-=3000'
        }).add({
            targets: this.koalaTargs.koala,
            translateX: 0,
            rotate: '90deg',
            opacity: 0,
            duration: 3000,
            elasticity: 0
        });

        this.$bus.$on('koalaAnimation', obj =>{this.koalaRestart(obj)});
    
  },
  methods:{
      koalaRestart: function (input) {
        if(input == this.idsuffix){
            if(!this.koala_animation.began) this.koala_animation.play();
            if (this.koala_animation.completed) this.koala_animation.restart();
        }
    }
  }
}
</script>

